//index.js
//获取应用实例
var app = getApp()

var util = require('../../utils/util.js')
var {Api} = require('../../utils/api.js')
var Zan = require('../../dist/index')

import {$wuxButton} from '../../wux/components/wux'

var book = new Api('book')

console.log(util)

Page(Object.assign({}, Zan.Tab, {
    data: {
        books: {},
        inputShowed: false,
        inputVal: "",
        tab: {
            list: [{
                id: '1',
                title: '最新商品1'
            }, {
                id: '2',
                title: '最新商品2'
            }, {
                id: '3',
                title: '最新商品3'
            }, {
                id: '4',
                title: '最新商品4'
            }, {
                id: '5',
                title: '最新商品5'
            }, {
                id: '6',
                title: '最新商品6'
            }],
            selectedId: '1',
            scroll: true,
            height: 45
        },
        index: 3,
        opened: !1,
    },
    //事件处理函数
    bindViewTap: function (event) {
        var target = event.currentTarget
        wx.navigateTo({
            url: `../detail/detail?id=${target.dataset.id}`
        })
    },
    onLoad: function () {
        console.log('onLoad')

        this.initButton()
    },

    onShow() {
        var that = this
        //调用应用实例的方法获取全局数据
        book.all(data => {
            util.log(data)
            that.setData({
                books: data
            })
        })
    },

    initButton(position = 'bottomRight') {
        this.setData({
            opened: !1,
        })

        this.button = $wuxButton.init('br', {
            position: position,


            buttons: [
                {
                    label: '扫码卖书',
                    icon: "data:image/png;base64,"
                },
                {
                    label: '编辑资料',
                    icon: "data:image/png;base64,",
                },
                {
                    label: '历史交易',
                    icon: "data:image/png;base64,",
                },
                {
                    label: '购物车',
                    icon: "data:image/png;base64,",
                }

            ],
            buttonClicked(index, item) {
                index === 0 && wx.navigateTo({
                    url: '/pages/scan/scan'
                })

                index === 1 && wx.navigateTo({
                    url: '/pages/info/index'
                })

                index === 2 && wx.navigateTo({
                    url: '/pages/history/history'
                })

                index === 3 && wx.navigateTo({
                    url: '/pages/cart/cart'
                })

                return true
            },
            callback(vm, opened) {
                vm.setData({
                    opened,
                })
            },
        })
    },

    showInput: function () {
        this.setData({
            inputShowed: true
        });
    },
    hideInput: function () {
        this.setData({
            inputVal: "",
            inputShowed: false
        });
    },
    clearInput: function () {
        this.setData({
            inputVal: ""
        });
    },
    inputTyping: function (e) {
        this.setData({
            inputVal: e.detail.value
        });
    },

    handleZanTabChange(e) {
        var componentId = e.componentId;
        var selectedId = e.selectedId;

        this.setData({
            [`${componentId}.selectedId`]: selectedId
        });
    }
}))
